import React from 'react'
import "./Video.css";

function Video() {
    return (
        <div className="video">
            <h1>Hello From Video</h1>
            <video
                className="videoPlayer"
                loop
                src="https://v16-web.tiktok.com/video/tos/useast2a/tos-useast2a-ve-0068c004/fef396f8a8a14154976bfeb400427bd6/?a=1988&br=2484&bt=1242&cd=0%7C0%7C1&ch=0&cr=0&cs=0&cv=1&dr=0&ds=3&er=&expire=1630344262&ft=9wMeReta4kag3&l=202108301124110101890741484B64073E&lr=tiktok_m&mime_type=video_mp4&net=0&pl=0&policy=3&qs=0&rc=M2l5aDg6ZjNrNzMzNzczM0ApNjY4N2Q3M2U2NzVnPDo1ZmcuXl9lcjRfMzBgLS1kMTZzc18zNjRhXi1gMzEuLS8uYDM6Yw%3D%3D&signature=e0b454d68eb8871524172d76c073242e&tk=0&vl=&vr=">
            </video>
        </div>
    )
}

export default Video;
